import React from 'react'

export default ({ projects }) => {
  return (
      projects && projects.map((text, index) =>
      <div class='project-page-wrapper'>
        <div class='row'>
          <div class='column'>

              {text}

          </div>
        </div>
      </div>
      )
  )
}
